import React from 'react';
import { Typography, Paper } from '@mui/material';

function Pricing() {
  return (
    <Paper style={{ padding: '20px' }}>
      <Typography variant="h6">Pricing</Typography>
      {/* Add your pricing content here */}
    </Paper>
  );
}

export default Pricing;
